import PropTypes from "prop-types";

export function Page(props) {
  const { year, photos } = props;
  return(
    <div>
      <p>У тебя {photos.length} фото за {year} год</p>
    </div>
  )
}

Page.propTypes = {
  photos: PropTypes.array.isRequired,
  year: PropTypes.number.isRequired,
}
